import React, { Component } from 'react'

export class Useritem extends Component {
    constructor(){
        super();
        this.state = {
            id : 'id',
            login : 'kaka',
            avatar_url : 'https://avatars2.githubusercontent.com/u/1311782?s=400&u=4b0e53d7ce7765fa39606af1a6bf30ecc3840562&v=4',
            html_url: 'https://github.com/zeeshanhanif',
        }
    }
    
    render() {
        return (
            <div>
              User Item
            </div>
        )
    }
}

export default Useritem
